import React from 'react';
import {withRouter} from 'react-router';
import '../../assets/css/landingPage.css'
import logo from '../../assets/images/logo.svg'
import { WhiteTextField } from '../../assets/inputTypes/inputTypes'
import {makeStyles, createMuiTheme} from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import { ThemeProvider } from '@material-ui/styles';

const useStyles = makeStyles(theme => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
    },
    margin: {
      margin: theme.spacing(1),
    },
  }));

  const theme = createMuiTheme({
    palette: {
      primary: {
        main: '#fff',
      },
    },
  });

  let buttonDisabled = true;

  const handleChange = () => {
    console.log('Chaning');

  };

const classes = useStyles();

class LandingPage extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        return (
            <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p className='inputs'>
                Welcome to the Science Spelling Training.<br/><br/>
                Please enter your name:
                <div className='name-input-container'>
                    <WhiteTextField id="name-input" fullWidth label="Name" variant="outlined" onChange={handleChange}/>
                </div>
                </p>

                <ThemeProvider theme={theme}>
                <Button variant="contained" color="primary" size='large' disabled={buttonDisabled}>
                    Continue
                </Button>
            </ThemeProvider>
            </header>
            </div>
        );
    }
}

export const LandingPageView = withRouter(LandingPage);
